import {toast} from "vue3-toastify";
import * as ExcelJS from "exceljs";
import jsPDF from "jspdf";
import "jspdf-autotable";
import dayjs from "dayjs";
import {currentCurrency} from "./useCurrentCurrency";
import _ from "lodash";
// Define a generic column mapping type
type ColumnMapping = {
	key: string;
	label: string;
	formatter?: (value: any) => string;
};

export function useExport(customTitle?: string) {
	const normalizeText = (text: string) => {
		// Add Turkish character support
		return (
			text
				.replace(/ı/g, "i")
				.replace(/İ/g, "I")
				.replace(/ğ/g, "g")
				.replace(/Ğ/g, "G")
				.replace(/ü/g, "u")
				.replace(/Ü/g, "U")
				.replace(/ş/g, "s")
				.replace(/Ş/g, "S")
				.replace(/ö/g, "o")
				.replace(/Ö/g, "O")
				.replace(/ç/g, "c")
				.replace(/Ç/g, "C") || "-"
		);
		// return text;
	};

	const generateExportData = (items: any[], columnMappings: ColumnMapping[]) => {
		return items.map((item: any) => {
			const exportItem: any = {};
			columnMappings.forEach((col) => {
				const value = col.key.split(".").reduce((obj, key) => obj?.[key], item);
				exportItem[col.label] = col.formatter ? col.formatter(value) : value ?? "-";
			});
			return exportItem;
		});
	};
	const exportToExcel = async (
		items: any[],
		expandedItems?: any[], // New parameter for expanded items
		exportType: "all" | "selected" = "all",
		columnMappings?: any[],
		expandedColumnMappings?: any[], // New parameter for expanded column mappings
	) => {
		try {
			if (!items || items.length === 0) {
				toast.warning("Dışa aktarılacak veri yok", {autoClose: 2000});
				return;
			}

			const logoPath2 = "static/logo.png";

			// Use default mappings if not provided
			const defaultColumnMappings: ColumnMapping[] = [
				{key: "fabricManufactur", label: "Üretici Adı"},
				{key: "meter", label: "Metre"},
				{
					key: "price",
					label: "Fiyat",
					formatter: (value) => `${value} ${currentCurrency.value.name}`,
				},
				{key: "ballCount", label: "Top Sayısı"},
				{
					key: "createdDate",
					label: "Oluşturma Tarihi",
					formatter: (value) => dayjs(value).format("DD.MM.YYYY"),
				},
				{
					key: "arriveDate",
					label: "Tamamlanma Tarihi",
					formatter: (value) => (value ? dayjs(value).format("DD.MM.YYYY") : "-"),
				},
				{key: "fabricType.name", label: "Kumaş Adı"},
				{key: "fabricType.code", label: "Kumaş Kodu"},
				{key: "fabricType.color.name", label: "Kumaş Rengi"},
				{
					key: "isArrived",
					label: "Tamamlanma Durumu",
					formatter: (value) => (value ? "EVET" : "HAYIR"),
				},
			];

			const exportData = generateExportData(items, columnMappings || defaultColumnMappings);

			// Create a new workbook and worksheet
			const workbook = new ExcelJS.Workbook();
			const worksheet = workbook.addWorksheet(customTitle || "Kayıtlar");

			// Add headers with bold styling
			const headers = (columnMappings || defaultColumnMappings).map((col) => col.label);

			// Add top info area with logo
			let imageId;
			try {
				imageId = workbook.addImage({
					buffer: await fetch(logoPath2).then((r) => r.arrayBuffer()),
					extension: "png",
				});
			} catch (logoError) {
				console.warn("Logo could not be added:", logoError);
			}

			// Add top info row
			const topInfoRow = worksheet.addRow([`Rapor Tarihi: ${dayjs().format("DD.MM.YYYY")}`, ...Array(headers.length - 1).fill("")]);
			topInfoRow.font = {bold: true};

			// Add logo to top info area
			if (imageId !== undefined) {
				worksheet.addImage(imageId, {
					tl: {col: headers.length, row: 0},
					ext: {width: 140, height: 50},
				});
			}

			worksheet.addRow(headers);

			worksheet.getRow(2).fill = {
				type: "pattern",
				pattern: "solid",
				fgColor: {argb: "FF7D1D60"}, // Ozce purple color
			};
			worksheet.getRow(2).font = {
				color: {argb: "FFFFFFFF"}, // White color
				bold: true,
				size: 12,
			};
			worksheet.getRow(2).getCell(headers.length + 1).fill = {
				type: "pattern",
				pattern: "solid",
				fgColor: {argb: "FFFFFFFF"}, //  transparent
			};

			// Add data rows
			exportData.forEach((item) => {
				worksheet.addRow(Object.values(item));
			});

			// Set column widths
			const columnWidths = [
				{width: 30}, // Üretici Adı
				{width: 10}, // Metre
				{width: 15}, // Fiyat
				{width: 12}, // Top Sayısı
				{width: 20}, // Oluşturma Tarihi
				{width: 20}, // Tamamlanma Tarihi
				{width: 20}, // Kumaş Adı
				{width: 15}, // Kumaş Kodu
				{width: 20}, // Kumaş Rengi
				{width: 20}, // Tamamlanma Durumu
			];
			worksheet.columns = columnWidths;

			// Add expanded items to a separate sheet if exists
			let rowDetailsWorksheet: any[] = [];
			if (expandedItems && expandedItems.length > 0) {
				const expandedData = generateExportData(expandedItems, expandedColumnMappings || []);
				rowDetailsWorksheet.push(...expandedData);
			}

			// Add row details to a separate sheet if exists
			if (rowDetailsWorksheet.length > 0) {
				const detailsWorksheet = workbook.addWorksheet("Detaylar");

				// Add headers with bold styling for details sheet
				const detailHeaders = Object.keys(rowDetailsWorksheet[0]);
				detailsWorksheet.addRow(detailHeaders);
				detailsWorksheet.getRow(1).fill = {
					type: "pattern",
					pattern: "solid",
					fgColor: {argb: "FF7D1D60"}, // Ozce purple color
				};
				detailsWorksheet.getRow(1).font = {
					color: {argb: "FFFFFFFF"}, // White color
					bold: true,
					size: 12,
				};

				// Add data rows
				rowDetailsWorksheet.forEach((item) => {
					detailsWorksheet.addRow(Object.values(item));
				});
			}

			const filename = `${customTitle ? _.snakeCase(customTitle) : "Kayitlar"}_${exportType}_${dayjs().format("YYYY-MM-DD_HH-mm-ss")}.xlsx`;

			// Write the file
			const buffer = await workbook.xlsx.writeBuffer();
			const blob = new Blob([buffer], {type: "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet"});
			const link = document.createElement("a");
			link.href = URL.createObjectURL(blob);
			link.download = filename;
			link.click();
			URL.revokeObjectURL(link.href);

			toast.success(`Excel'e ${exportData.length} adet kayıt aktarıldı`, {autoClose: 1300});
		} catch (error) {
			console.error("Excel export error:", error);
			toast.error("Excel'e aktarma sırasında bir hata oluştu", {autoClose: 1300});
		}
	};

	const exportToPDF = async (
		items: any[],
		fetchRowDetails?: (id: number) => Promise<any>,
		exportType: "all" | "selected" = "all",
		columnMappings?: ColumnMapping[],
		expandedColumnMappings?: any[],
		expandedItems?: any[], // New parameter for expanded items
	) => {
		try {
			if (!items || items.length === 0) {
				toast.warning("Dışa aktarılacak veri yok", {autoClose: 2000});
				return;
			}

			// Fetch row details for each item if fetchRowDetails is provided
			const itemsWithDetails = await Promise.all(
				items.map(async (item) => {
					if (fetchRowDetails) {
						const details = await fetchRowDetails(item.id);
						return {...item, details: details?.data || []};
					}
					return item;
				}),
			);

			// Default column mappings
			const defaultColumnMappings: ColumnMapping[] = [
				{key: "fabricManufactur", label: "Üretici Adı"},
				{key: "meter", label: "Metre"},
				{
					key: "price",
					label: "Fiyat",
					formatter: (value) => `${value} ${currentCurrency.value.name}`,
				},
				{key: "ballCount", label: "Top Sayısı"},
				{
					key: "createdDate",
					label: "Oluşturma Tarihi",
					formatter: (value) => dayjs(value).format("DD.MM.YYYY"),
				},
				{
					key: "arriveDate",
					label: "Tamamlanma Tarihi",
					formatter: (value) => (value ? dayjs(value).format("DD.MM.YYYY") : "-"),
				},
				{key: "fabricType.name", label: "Kumaş Adı"},
				{key: "fabricType.code", label: "Kumaş Kodu"},
				{key: "fabricType.color.name", label: "Kumaş Rengi"},
				{
					key: "isArrived",
					label: "Tamamlanma Durumu",
					formatter: (value) => (value ? "EVET" : "HAYIR"),
				},
			];

			// Combine main items and expanded items
			const combinedItems = [...itemsWithDetails];

			const doc: any = new jsPDF({
				orientation: "landscape",
				unit: "mm",
				format: "a4",
			});
			doc.setLanguage("tr");
			doc.setFont("helvetica");

			// Prepare columns and rows
			const mappings = columnMappings || defaultColumnMappings;
			const tableColumns = mappings.map((col) => normalizeText(col.label));
			const tableRows = combinedItems.map((item: any) =>
				mappings.map((col) => {
					const value = col.key.split(".").reduce((obj, key) => obj?.[key], item);
					const formattedValue = col.formatter ? col.formatter(value) : value ?? "-";
					return normalizeText(formattedValue.toString());
				}),
			);

			// Add logo to top right of the page

			const pageWidth = doc.internal.pageSize.width;
			const logoWidth = 50; // Adjust logo width as needed
			const logoHeight = 15; // Adjust logo height as needed
			const logoB64 = "data:image/png;base64,"
			doc.addImage(logoB64, "PNG", pageWidth - logoWidth - 15, 5, logoWidth, logoHeight);

			// Title and metadata
			doc.setFontSize(16);
			const titleText =
				exportType === "all"
					? normalizeText(customTitle || "Tüm Kayıtlar Raporu")
					: normalizeText(combinedItems.length === 1 ? customTitle || "Seçili Kayıt" : customTitle || "Seçili Kayıtlar Raporu");
			doc.text(titleText, 15, 15);

			doc.setFontSize(10);
			doc.text(`Rapor Tarihi: ${dayjs().format("DD.MM.YYYY HH:mm:ss")}`, 15, 22);

			// Main table
			doc.autoTable({
				head: [tableColumns],
				body: tableRows,
				startY: 30,
				styles: {
					fontSize: 10,
					lineHeight: 1.5,
					cellPadding: 2,
					overflow: "linebreak",
				},
				headStyles: {
					fillColor: [125, 29, 96], // Ozce purple background for header
				},
				columnStyles: mappings.reduce((acc: any, col: any, index: number) => {
					if (col.width) {
						acc[index] = { cellWidth: col.width };
					}
					return acc;
				}, {}),
			});

			// add row details to the pdf
			if (fetchRowDetails || (expandedItems && expandedItems.length > 0 && expandedColumnMappings && expandedColumnMappings.length > 0)) {
				const expandedTableColumn = (expandedColumnMappings || []).map((col) => normalizeText(col.label));
				const mappedExpandedItems = (expandedItems || []).map((item: any) =>
					(expandedColumnMappings || []).map((col) => {
						const value = col.key.split(".").reduce((obj: any, key: any) => obj?.[key], item);
						const formattedValue = col.formatter ? col.formatter(value) : value ?? "-";
						return normalizeText(formattedValue.toString());
					}),
				);
				console.log("mappedDetails", mappedExpandedItems);
				doc.autoTable({
					head: [expandedTableColumn],
					body: mappedExpandedItems,
					styles: {
						fontSize: 10,
						lineHeight: 1.5,
						cellPadding: 2,
						overflow: "linebreak",
					},
					headStyles: {
						fillColor: [125, 29, 96], // Ozce purple background for header
					},
				});
			}

			// Add page numbers
			const addPageNumbers = () => {
				const pageCount = doc.internal.getNumberOfPages();
				for (let i = 1; i <= pageCount; i++) {
					doc.setPage(i);
					doc.setFontSize(10);
					doc.text(`Sayfa ${i} / ${pageCount}`, doc.internal.pageSize.width - 30, doc.internal.pageSize.height - 10);
				}
			};

			const filename = `${customTitle ? _.snakeCase(customTitle) : "Kayitlar"}_${exportType}_${dayjs().format("YYYY-MM-DD_HH-mm-ss")}.pdf`;

			addPageNumbers();
			doc.save(filename);

			toast.success(`PDF'e ${combinedItems.length} adet kayıt aktarıldı`, {autoClose: 1300});
		} catch (error) {
			console.error("PDF export error:", error);
			toast.error("PDF'e aktarma sırasında bir hata oluştu", {autoClose: 1300});
		}
	};

	return {
		exportToExcel,
		exportToPDF,
	};
}
